function myconf(){var cf=$.Deferred();$.ajax({type:'POST',url:'feedback/',dataType:'json',data:'act=cfg',success:function(answer){cf.resolve(answer.configs);}});return cf;}
var mcf=myconf();mcf.done(function(conf){$(document).ready(function(){(function(){var fb=$('.feedback');if(fb.length>0){fb.each(function(){var form=$(this).closest('form'),name=form.attr('name');if(isset(conf[name])&&isset(conf[name].cfg.antispamjs)){$(form).prepend('<input type="text" name="'+conf[name].cfg.antispamjs+'" value="tesby" style="display:none;">');}});}})();});function feedback(vars){var bt=$(vars.form).find('.feedback');var btc=bt.clone();var bvc=bt.val();var cfg=conf[vars.act].cfg;$.ajax({type:'POST',url:'feedback/',cache:false,dataType:'json',data:'act='+vars.act+'&'+vars.data,beforeSend:function(){$(bt).prop("disabled",true);$(bt).addClass('loading');},success:function(answer){if(isset(cfg.notify)&&!/none/i.test(cfg.notify)){if(/textbox/i.test(cfg.notify)){if(isset(answer.errors)){$.each(answer.errors,function(k,val){$.jGrowl(val,{theme:'error',header:'Ошибка!',life:3000});});}if(isset(answer.infos)){$.each(answer.infos,function(k,val){$.jGrowl(val,{theme:'infos',header:'Внимание!',life:3000});});}}if(/color/i.test(cfg.notify)){$(vars.form).find('input[type=text]:visible, textarea:visible, select:visible').css({'border':'1px solid #D7D5CF'},300);if(isset(answer.errors)){$.each(answer.errors,function(k,val){var reg=/[a-z]/i;if(reg.test(k)){var e=$(vars.form).find('[name='+k+']');if(e.length==1){$(e).css({'border':'1px solid #FF532E'},100);}}});}
if(isset(answer.infos)){var msg=''
$.each(answer.infos,function(k,val){msg+=val+' ';});if(/modal/i.test(cfg.notify)){$('.overlay').removeClass('overlay--active');var res='<section class="overlay overlay--result">';res+='<div class="form form--popup"><div class="overlay__close overlay__close--form overlay__close--remove"></div>'
res+=msg;res+='</div></section>';$('body').append(res);$('.overlay--result').addClass('overlay--active');}}}}
$(bt).prop("disabled",false);$(bt).removeClass('loading');if(isset(answer.ok)&&answer.ok==1){$(vars.form)[0].reset();}}});}
$(document).on('mouseenter mouseover','.feedback',function(){var form=$(this).closest('form'),name=form.attr('name');if(isset(conf[name])&&isset(conf[name].cfg.antispamjs)){$('input[name='+conf[name].cfg.antispamjs+']').val('');}});$(document).on('click','.feedback',function(){var form=$(this).closest('form'),name=form.attr('name'),obj={};obj.form=form;obj.act=name;obj.data=$(form).serialize();feedback(obj);return false;});});